import { redirectToCheckout, loadAirwallex } from 'airwallex-payment-elements';


const intent_id = 'int_3l3nkfuMzVUBtVcgzAekaYsGYa';
const client_secret = 'eyJhbGciOiJIUzI1NiJ9.eyJpYXQiOjE2MDkzODQ1MDEsImV4cCI6MTYwOTM4ODEwMSwiYWNjb3VudF9pZCI6IjZkMzljOGU3LWQyY2EtNGQ0Yy04N2I5LWIzY2Y3MzNkNTU2ZSIsImRhdGFfY2VudGVyX3JlZ2lvbiI6IlVLIiwiaW50ZW50X2lkIjoiaW50XzNsM25rZnVNelZVQnRWY2d6QWVrYVlzR1lhIn0.UJ7OAvJ7hVCiMaZgCQW-GjPeIx-NAjp5ZOQotsG-JSc';

async function redirectHpp(){
  try {
    await loadAirwallex({
      env: 'staging',
      origin: window.location.origin
    });
    await redirectToCheckout({
      env: 'staging',
      id: intent_id,
      client_secret: client_secret,
    })
  } catch(e) {
    console.error('there was an error', e);
  }
}

function hpp() {
  return (
    <div>
      <h2>Host Payment Page (HPP) Integration</h2>
      <button onClick={redirectHpp}>Click to redirect</button>
    </div>
  )
}

export default hpp
